import React from 'react'
import './Post.css'

import Avatar from '@material-ui/core/Avatar'


function Post() {
    return (
        <div className="post">
            <h3>username</h3>
            <img className="post_image" src="https://upload.wikimedia.org/wikipedia/commons/thumb/a/a7/React-icon.svg/1200px-React-icon.svg.png    "></img>
            <h4 className="post_text"><strong>userName</strong> : caption</h4>

        </div>
    )
}

export default Post
